*,
*::before,
*::after{
    padding: 0;
    margin: 0;
    box-sizing: inherit;
    overflow-x: hidden;
}

body{
    box-sizing: border-box;
    font-family: 'Montserrat', sans-serif;
}

#home {
    background-image: url('/36d35571d68d23dc67c0f23eac0612d9.jpeg');
    height: 100vh;
    background-position: center center;
    background-size: cover;
    background-repeat: no-repeat;   
    background-attachment: fixed;
}

/* ------------------NAVBAR---------------- */
.navbar{    
    transition: background-color .5s ease;
}
.navbar-brand{
    font-size: 2rem;
    font-weight: bold;
    color: crimson;
}
.nav-link:focus,
.nav-link,
.nav-link:active,
.nav-link:visited{
    color:crimson;
    font-weight: 700;
}
.navbar-brand.active,
.navbar-brand:hover,
.navbar-nav .nav-link.active,
.navbar-nav .nav-link:hover{
   color:#F09CAC;
}
.navbar.solid,
 .navbar.solid-toggle{
    background-color: #fff;          
}


.offset::before{
    content: "";
    height: 4rem;
    display: block;
    margin-top: -4rem;
 }
.hero{
    position:absolute;
    top:50%;
    left: 50%;
    transform: translate(-50%,-50%);
    text-align: center;

}
.hero h1{
    font-size: 3rem;
    text-transform: capitalize;
    letter-spacing: .3rem;
    font-weight: 700;
    padding-bottom: 3rem;
    color:#fff;
}

.hero a{
    font-size: 1.2rem;
    padding:1rem 2.5rem;
    text-transform: uppercase;
}
.navbar-toggler,
.navbar-toggler-icon{
    color:crimson;
}
/* --------------------END NAVBAR--------------------- */

/* -----------ABOUT SECTION--------- */
.about-section{
    padding-top: 8rem;
}
.about-section h1{
    color:crimson;
    font-size: 2rem;
}
.about-section p{
    font-size: 1.2rem;
}

/* ---------------END ABOUT SECTION-------------- */

/* -----------------CLASSES---------------------- */

#classes{
   background-color: #000;
   padding: 5rem 2rem;
   margin-top: -6.7rem;
}
#classes h3{
    overflow-y: hidden;
}

#classes h4{
    overflow-y: hidden;
    font-weight: 700;
    font-size:1.2rem;
}

.text-underline{
    width:5rem;
    height: .2rem;
    background-color: crimson;    
}

/* ----------------TEAM----------------------- */
.owl-stage{
    display: flex;
 }
.card{
   height: 100%;   
   border-radius: 0;
   text-align: center;
   margin:0 1rem;
   border:1rem solid rgba(158, 91, 91, 0.05);
   box-shadow: rgba(0, 0, 0, 0.35) 0px 5px 15px;
   transition: trasnform .6s linear;
   background-color: #000;
   color:#fff;
}
button.owl-dot.active span,
button.owl-dot:hover span{
   background-color: crimson !important;
}
ul.social{
    list-style: none;
    padding:0;
    margin:0;
    font-size: 1.5rem;
 }
 ul.social li{
    display: inline;
    padding-right: .8rem;   
 }
 ul.social li a{
    color: crimson;
    transition: all .5s ease;
 }
 ul.social li a:hover{
    color: crimson;
 }


/* -----------------END CLASSES--------------------- */

/* --------------------TEAM----------------------------- */
#team{

    background-image: url('/79adf05a8fe0d428e5196bb98269caa4.jpg');
    background-position: center center;
    background-size: cover;
    background-repeat: no-repeat;
    height: 100%;    
}
.team-card{
    overflow-y: hidden;
}


/* ---------------------END TEAM------------------------- */

/* --------------------PRICING---------------------------- */
.jumbotron {
    padding: 2rem 1rem;
    margin-bottom: 2rem;
    background-color:#fff;
    border-radius: .3rem;
  }

  .pricing-column {
    background-color: #000;
    height: 100%;
    padding: 1.6rem;
    border-top: .25rem solid crimson;
    box-shadow: 0 0 .8rem rgba(0, 0, 0, .075);
    position: relative;
    overflow: hidden;
    color: #fff;

 }
.pricing-column p {
    height: 5rem;
    font-size: 1.1rem;
}

.pricing-column h4 {
    font-size: .8rem;
    font-weight: 700;
    text-transform: capitalize;    
 }

 .ribbon {
    background-color: crimson;
    color: white;
    font-size: .8rem;
    font-weight: 700;
    height: 2rem;
    width: 10rem;
    padding-top: .4rem;
    position: absolute;
    transform: rotate(45deg);
    right: -2.8rem;
    top: 1.5rem;
    box-shadow: 0 0 .2rem rgba(0, 0, 0, .25);
 }

 .pricing-cards{
     overflow-y: hidden;
 }


/* ---------------------END PRICING-------------------------- */
/* ----------------START CLIENTS----------------------------- */
#clients {
    background-color: #000;
    color:#fff;
}
#clients-carousel {
    max-width: 1200px;
    margin: 0 auto;
 }
 .clients img {
    border-radius: 50%;
    transition: transform .3s ease;
 }
 .clients img:hover {
    transform: scale(.95);
 }
 blockquote .svg-inline--fa {
    margin: 1rem;
    color: crimson;
 }
 .clients-hr {
    border-top: .1rem solid #1EBBA3;
 }

/* --------------------END CLIENTS-------------------------------- */

/* ------------------START CONTACT----------------------- */
#contact{
    background-image: url('/4fe9d54c4a7f0f18e1f3ba8427db480b.jpg');
    background-size: cover cover;
    background-position: center;
    background-repeat: no-repeat;
    height: 100%;
}

.overflow{
    overflow-y: hidden;
}

 /*--- Contact Form --*/
 .form-group {
    margin-bottom: 1.3rem;
 }
 .form-control {
    background-color: #53595f;
    border-radius: 0;
    border: .15rem solid #fff;
    color: white!important;
    font-size: 1.1rem;
 }
 .contact-address{
     background-color: #53595f;
 }
 .form-control:focus {
    background-color: #53595f;
    border: .15rem solid #fff;
 }
 .form-group input::placeholder,
 .form-group textarea::placeholder {
    color: #fff!important;
 }
 hr.socket {
    border-top: .2rem solid crimson;
    width: 90%;  
     margin:0 auto; 
 }

/* ----------------------END CONTACT-------------------------- */

/* ------------------TOP SCROLL-------------------------------- */
a.top-scroll {
    right: 1.2rem;
    bottom: 1.2rem;
    position: fixed;
    opacity: .4;
    z-index: 1000;
    display: none;
 }
 a.top-scroll:hover {
    opacity: .5;
 }
 .top-scroll .svg-inline--fa {
    background: crimson;
    color: #fff;
    font-size: 3rem;
    height: 1.7rem;
 }
/* ---------------------END SCROLL----------------------- */
