/* xsm */
@media (max-width: 575.98px) {
    .class-margin-sm{
        margin-top: 3rem;
    }

 }

/* sm */
@media (max-width: 767.98px) { 
    .hero h1{
        font-size: 2rem;
        text-transform: capitalize;
        letter-spacing: .2rem;
        font-weight: 700;
        padding-bottom: 3rem;
        color:#fff;
    }

    .hero a{
        font-size: 1rem;
        padding:.8rem 2rem;
        text-transform: uppercase;
    }
    .about-section p {
        font-size: 1rem;              
    }
    .top-scroll {
        display: none!important;
     }

 }

/* md */
@media (max-width: 991.98px) { 
    #classes{
        margin-top: -5rem;       
    }
    .clients img {
        max-width: 50%;
        margin: 0 auto;
     }

 }
/* lg */
 @media (max-width: 1199.98px) { 
    .about-section p {
        font-size: 1rem;
        margin-bottom: 5rem;

    }
    .about-section h1{
        font-size: 2rem;
    }
    #classes{
        margin-top: -6rem;
    }

  }
  /* xl */
  @media (max-width: 1399.98px) {
    #classes{
        margin-top: -6rem;
    }

   }

